(341, 105, '_form', '<p>Les champs marqués d\'une astérisque* sont obligatoires</p>\n\n<div class=\"row mx-2 g-3 mb-4\">\n\n  <div class=\"col-12\">\n    [radio radio-gender use_label_element default:1 \"Mme.\" \"Mr.\"]\n  </div>\n\n  <div class=\"col-md-6\">\n    [text* your-firstname class:form-control placeholder \"Prénom*\"]\n  </div>\n\n  <div class=\"col-md-6\">\n    [text* your-lastname class:form-control placeholder \"Nom*\"]\n  </div>\n\n  <div class=\"col-md-6\">\n    [email* your-email class:form-control placeholder \"Email*\"]\n  </div>\n\n  <div class=\"col-md-6\">\n    [email* your-phone class:form-control placeholder \"Téléphone*\"]\n  </div>\n\n  <div class=\"col-12\">\n    [text your-subject class:form-control placeholder \"Objet\"]\n  </div>\n\n  <div class=\"col-12\">\n    [textarea your-message class:form-control placeholder \"Message\"]\n  </div>\n\n  <div class=\"col-12 d-flex justify-content-end\">\n    <button type=\"submit\" class=\"btn btn-outline-success wpcf7-submit\">Envoyer</button>\n  </div>\n</div>'),
