(105, 1, '2023-03-23 17:18:42', '2023-03-23 16:18:42', '<p>Les champs marqués d\'une astérisque* sont obligatoires</p>\r\n\r\n<div class=\"row mx-2 g-3 mb-4\">\r\n\r\n  <div class=\"col-12\">\r\n    [radio radio-gender use_label_element default:1 \"Mme.\" \"Mr.\"]\r\n  </div>\r\n\r\n  <div class=\"col-md-6\">\r\n    [text* your-firstname class:form-control placeholder \"Prénom*\"]\r\n  </div>\r\n\r\n  <div class=\"col-md-6\">\r\n    [text* your-lastname class:form-control placeholder \"Nom*\"]\r\n  </div>\r\n\r\n  <div class=\"col-md-6\">\r\n    [email* your-email class:form-control placeholder \"Email*\"]\r\n  </div>\r\n\r\n  <div class=\"col-md-6\">\r\n    [email* your-phone class:form-control placeholder \"Téléphone*\"]\r\n  </div>\r\n\r\n  <div class=\"col-12\">\r\n    [text your-subject class:form-control placeholder \"Objet\"]\r\n  </div>\r\n\r\n  <div class=\"col-12\">\r\n    [textarea your-message class:form-control placeholder \"Message\"]\r\n  </div>\r\n\r\n  <div class=\"col-12 d-flex justify-content-end\">\r\n    <button type=\"submit\" class=\"btn btn-outline-success wpcf7-submit\">Envoyer</button>\r\n  </div>\r\n</div>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <contact@concept-bois.alainbroye.fr>\n[_site_admin_email]\nDe : [your-firstname] [your-lastname] [your-email]\r\nObjet : [your-subject]\r\n\r\nCorps du message :\r\nNom : [your-lastname]\r\nPrénom : [your-firstname]\r\nTéléphone : [your-phone]\r\nE-mail : [your-email]\r\n\r\nObjet : [your-subject]\r\n\r\nMessage :\r\n[your-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de contact de [_site_title] ([_site_url])\nReply-To: [your-email]\n\n1\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <alain.broye@live.fr>\n[your-email]\nCorps du message :\r\n[your-message]\r\n\r\n-- \r\nCet e-mail a été envoyé via le formulaire de contact de [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nMerci pour votre message. Il a été envoyé.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nUn ou plusieurs champs contiennent une erreur. Veuillez vérifier et essayer à nouveau.\nUne erreur s’est produite lors de l’envoi de votre message. Veuillez essayer à nouveau plus tard.\nVous devez accepter les termes et conditions avant d’envoyer votre message.\nVeuillez renseigner ce champ.\nCe champ à une date trop tardive.\nCe champ à un numéro trop court.\nUne erreur inconnue s’est produite lors du téléversement du fichier.\nVous n’avez pas les droits nécessaires pour téléverser ce type de fichier.\nLe fichier téléversé est trop volumineux.\nUne erreur s’est produite lors du téléversement du fichier.\nSVP, entrez une date au format AAAA-MM-JJ\nCe champ à une date trop tôt.\nCe champ à une date trop tardive.\nVeuillez saisir un numéro.\nCe champ à un numéro trop court.\nCe champ a un numéro trop long.\nLa réponse à la question est incorrecte.\nVeuillez saisir votre adresse e-mail.\nVeuillez saisisr une URL\nVeuillez saisir un numéro de téléphone.', 'Contact', '', 'publish', 'closed', 'closed', '', 'formulaire-de-contact-1', '', '', '2023-03-23 22:31:15', '2023-03-23 21:31:15', '', 0, 'http://localhost:8888/wordpress/?post_type=wpcf7_contact_form&#038;p=105', 0, 'wpcf7_contact_form', '', 0),
