ideWhenUsed=\"true\"\n   Name=\"Unresolved Mention\"/>\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\n   Name=\"Smart Link\"/>\n </w:LatentStyles>\n</xml><![endif]-->\n\nVous êtes propriétaire d’une SCI ou bien bailleurs sociaux, nous avons\ntoutes une gamme de maisons adaptées pour une exploitation locative avec des\nprestations de qualités environnementales et économiques…\n\n<!-- /wp:paragraph --><!-- wp:paragraph -->\n\nNos délais de réalisation sont courts, nos chantiers sont propres, ne\nnécessite pas d’eau et ne génèrent aucune nuisance sonore pour le voisinage.\n\n<!-- /wp:paragraph --><!-- wp:paragraph -->\n\n<em>ZÉRO BÉTON</em> 100% BOIS\n\n<!-- /wp:paragraph --><!-- wp:paragraph -->\n\nToutes nos maisons, sont étudiées, conçues et fabriquées en France, notre\nimpact environnemental est faible, car l’usine de production se situe à moins\nde 300 km de nos chantiers.\n\n<!-- /wp:paragraph --><!-- wp:paragraph -->\n\nLes matériaux utilisés sont biosourcés et issus de forêts éco-gérées en\nFrance.\n\n<!-- /wp:paragraph --><!-- wp:paragraph -->\n\nCela vous intéresse !\n\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<a href=\"#\"><button class=\"btn btn-outline-success\" type=\"button\">Visitez notre site web spécialisé</button></a>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":127,\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"className\":\"is-style-default\"} -->\n<figure class=\"wp-block-image aligncenter size-full is-style-default\"><img class=\"wp-image-127\" src=\"https://concept-bois.alainbroye.fr/wp-content/uploads/2023/03/details_offre-768x561-1.png\" alt=\"\" /></figure>\n<!-- /wp:image -->', 'Programme investisseurs !', '', 'inherit', 'closed', 'closed', '', '1-autosave-v1', '', '', '2023-03-28 11:07:22', '2023-03-28 09:07:22', '', 1, 'https://etic.alainbroye.fr/?p=185', 0, 'revision', '', 0),
