(278, 1, '2023-03-29 18:42:21', '2023-03-29 16:42:21', '<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>LES BLOCS MODULAIRES</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le Bloc constructif est une solution écologique pour nos projets de construction de maison bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>C’est un bloc modulaire 100% bois, isolé et biosourcé. Il s’adapte à tous types d’architectures et nous laisse libre de bâtir la maison qui ressemble à nos clients !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Notre fournisseur développe et fabrique un système complet de blocs modulaires préfabriqués en bois comprenant murs, dalles, planchers, et éléments de toitures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce système est adaptable à toutes les envies architecturales et offre des performances thermiques supérieures aux normes en vigueur grâce à leur isolation en fibre de bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":127,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/details_offre-768x561-1.png\" alt=\"\" class=\"wp-image-127\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les avantages d’une construction en Blocs constructifs sont nombreux :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Confort thermique : au chaud l’hiver, au frais l’été,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Maison basse consommation,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Mise en œuvre rapide (nos projets sont réalisés en moins de 6 mois),</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Pas de limites architecturales,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>100% bois et biosourcé.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Comment le bloc est-il fabriqué ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont fabriqués en France dans les ateliers du fabricant situé en Savoie à moins de 300 km de Manosque. Ceci afin de limiter notre emprunte carbone et garantir nos délais de livraison.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont composés de panneau OSB Fibertech découpés, assemblés, pressés et stockés pour nous directement chez le fabricant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les équipes réalisent des contrôles continus en atelier pour l’équerrage et le dimensionnement des blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelles sont les garanties ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont certifiés CTB par FCBA et ont une garantie décennale fabricant comme tous fabricants d’ossature bois ou autre solution constructive.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelle est la densité de la laine de bois contenue dans les blocs&nbsp;?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>La densité de la laine de bois est insufflée à 45kg / m3. Elle est donc prisonnière du bloc et ne se tasse pas au fil des années.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quel est le R des murs ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le R des murs est de 5,26 puisque l’on utilise de la fibre de bois qui a un lambda de 0,038.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il du déphasage ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Pour le déphasage des murs, nous sommes aux alentours de 8h50 sur 200 mm d’isolant mais ce qui est le plus important est de regarder, si on travaille en façade ventilée.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans notre cas, toutes les façades le sont, car nous équipons nos maisons d’un revêtement crépis ou avec un bardage posé avec une lame d’air afin de combattre la chaleur et le rayonnement du soleil.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Comme toute maison bio climatique, nous portons une attention toute particulière aux ouvertures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La pose de casquettes au-dessus des grandes baies vitrées ou des stores adaptés seront mis en œuvre dès que cela est nécessaire aux heures les plus chaudes afin d’éviter le rayonnement intérieur et la montée en température.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir un très bon déphasage dans les murs c’est très bien, mais si le soleil tape directement dans les baies, cela ne sert à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le bloc constructif convient-il pour la RE2020 ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Aujourd’hui, il existe encore trop de flou sur cette nouvelle réglementation environnementale qui n’est pas encore en place.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On entend beaucoup de chose, mais rien n’est encore très clair de ce point de vue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On sait déjà qu’elle met en avant les matériaux biosourcés, ce qui est le cas de nos blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Côté isolant, avec 200 mm de fibre de bois, nous sommes certains d’être dans la norme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si elle reprend les grandes lignes de la RT 2012, c’est plus une norme de système, qui prend en compte les composants d’en la globalité, en regard à la maison en elle-même. (Ventilation, chauffage etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir des murs, plancher et toiture bien isolée, si le système de chauffage est énergivore, ou que la ventilation ne garantie pas une qualité de l’air intérieure optimale, cela ne sert encore une fois à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nous prenons en compte tous ces paramètres lors de nos réalisations afin d’optimiser les consommations d’énergie et d’offrir à notre clientèle une qualité de vie optimale et saine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il des COV (composés organiques volatils) ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs utilisent des panneaux OSB de type E1, donc on fait vraiment attention à choisir des panneaux qui soient les moins émetteurs de COV.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pareil pour la colle que l’on utilise, ce sont des colles sans formaldéhyde, on veille à avoir des composants les moins nocifs pour la qualité de l’air intérieure de nos maisons bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>Les dalles bois Zéro béton</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Elles offrent une alternative aboutie pour une maison 100% bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos dalles sont mises en œuvre en combinant une structure porteuse sur laquelle repose des poutres en I sur lesquelles sont placés les éléments de sols.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tous nos composants sont pré-taillés pour faciliter la mise en œuvre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Elles peuvent se poser sur des plots en béton ou sur des pieux vissés.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":218,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_Details-600x342-1.png\" alt=\"\" class=\"wp-image-218\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Caractéristiques :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Ceinture porteuse et sommiers en lamibois, ou lamellé-collé pré-taillés, pour pose sur plots béton ou pieux vissés (reprise des charges du plancher et des murs)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Solivage porteur poutre en I ou bois massif abouté</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Isolant intégré en fibre de bois épaisseur 200 mm R = 5,25 m2.k/W</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Pare vapeur faisant pare pluie de type sarking pour protéger temporairement l’isolant des intempéries.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<figure class=\"wp-block-image aligncenter size-large\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_MeP-copie-1024x537.png\" alt=\"\" class=\"wp-image-224\"/><figcaption class=\"wp-element-caption text center text-green\">Mise en place d’une dalle bois</figcaption></figure>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<div class=\"text-center\">\n  <div class=\"row\">\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMIBOIS</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamibois.png\" alt=\"lamibois\" class=\"wp-image-224\"></figure> \n    </div>\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMELLÉ COLLÉ</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamelle-colle.png\" alt=\"lamellé collé\" class=\"wp-image-224\"></figure>\n    </div>\n  </div>\n</div>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les murs porteurs</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos caissons permettent de réaliser des murs de toutes formes et acceptent toutes finitions, offrant ainsi une liberté architecturale totale.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs modulaires présentent une structure bois dans laquelle est insufflé une isolation en fibre de bois !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La combinaison innovante de ces matériaux écologiques permet d’obtenir des performances thermiques proches du passif avec les avantages de la préfabrication bois qui nous fera gagner du temps lors de la construction de nos maison grâce aux études réalisées en amont !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":245,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Schema-600x366-1.png\" alt=\"\" class=\"wp-image-245\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>La façade est fractionnée en éléments de différentes tailles (hauteur d’étage, allèges, linteaux) et de différentes formes (pignons triangulaires, angles non droits etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Éléments porteurs jusqu’à R+2 : reprise de charge 9 tonnes/ml</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Isolant fibre de bois intégré R de base = 5.26 m2.k/W</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Performance été-hiver :</strong>&nbsp;déphasage de 8h50</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Étanche à l’air</strong>&nbsp;sans ajout de membrane</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Ouvert à la diffusion de vapeur d’eau</strong></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":250,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Details-600x410-1.png\" alt=\"\" class=\"wp-image-250\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Un bloc préfabriqué, 100 % sur mesure, déclinable en plus d’un million de formes différentes</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Manipulation aisée : le bloc hauteur d’étage mesure 2.80 m pour un poids de 60 kg</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Rapidité d’exécution : 100 m² au sol = 3 personnes en 2 jours</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Avantage du bois sans ses inconvénients : extrêmement stable sur le plan dimensionnel, l’OSB ne subit pas les variations hygrométriques de l’air contrairement au bois massif qui se gonfle et se rétracte</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tout est compris : lisses basses, quincaillerie, joints d’étanchéité, …</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher lamellé collé :</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Plancher lamellé-collé bois sous face apparente</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de dalles lamellé-collées de largeur 600 mm, d’épaisseur de 140 mm et d’une portée pouvant aller jusqu’à 6m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Grâce à l’épaisseur importante de la dalle, l’isolation sonore sera équivalente à une dalle béton, elle pourra, en plus, rester en sous face apparente !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher poutres Posi</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Poutre Posi</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une solution composée de poutres en bois et de membrures métalliques combinant légèreté et rigidité pour des portées allant jusqu’à 14 m sans porteur intermédiaire.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette solution facilite le passage des gaines de ventilation, des canalisations, sans aucun perçage.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":265,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Poutre-Posi.jpg\" alt=\"\" class=\"wp-image-265\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<br><p>Une offre structure complémentaire pour solutionner les planchers intermédiaires, avec deux produits techniques : la poutre en I ou la dalle lamellé-collé !</p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":266,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_Detail-600x540-1.png\" alt=\"\" class=\"wp-image-266\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER&nbsp;POUTRE EN I&nbsp;:</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de poutres porteuses, sommiers, poteaux et de trémie d’escalier suivi d’un plancher léger pré-taillé ayant une portée pouvant aller jusqu’à 7m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Manutention aisée, pose rapide et planéité facile à obtenir</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Percement des poutres simple pour passer les réseaux techniques dans l’épaisseur du plancher</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stabilité dimensionnelle des poutres en I, élimine tous les problèmes liés aux grincements du plancher.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER LAMELLÉ-COLLÉ :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->', 'Concept', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2023-03-29 18:42:21', '2023-03-29 16:42:21', '', 22, 'https://etic.alainbroye.fr/?p=278', 0, 'revision', '', 0),
(279, 1, '2023-03-29 18:42:33', '2023-03-29 16:42:33', '<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>LES BLOCS MODULAIRES</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le Bloc constructif est une solution écologique pour nos projets de construction de maison bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>C’est un bloc modulaire 100% bois, isolé et biosourcé. Il s’adapte à tous types d’architectures et nous laisse libre de bâtir la maison qui ressemble à nos clients !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Notre fournisseur développe et fabrique un système complet de blocs modulaires préfabriqués en bois comprenant murs, dalles, planchers, et éléments de toitures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce système est adaptable à toutes les envies architecturales et offre des performances thermiques supérieures aux normes en vigueur grâce à leur isolation en fibre de bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":127,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/details_offre-768x561-1.png\" alt=\"\" class=\"wp-image-127\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les avantages d’une construction en Blocs constructifs sont nombreux :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Confort thermique : au chaud l’hiver, au frais l’été,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Maison basse consommation,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Mise en œuvre rapide (nos projets sont réalisés en moins de 6 mois),</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Pas de limites architecturales,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>100% bois et biosourcé.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Comment le bloc est-il fabriqué ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont fabriqués en France dans les ateliers du fabricant situé en Savoie à moins de 300 km de Manosque. Ceci afin de limiter notre emprunte carbone et garantir nos délais de livraison.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont composés de panneau OSB Fibertech découpés, assemblés, pressés et stockés pour nous directement chez le fabricant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les équipes réalisent des contrôles continus en atelier pour l’équerrage et le dimensionnement des blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelles sont les garanties ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont certifiés CTB par FCBA et ont une garantie décennale fabricant comme tous fabricants d’ossature bois ou autre solution constructive.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelle est la densité de la laine de bois contenue dans les blocs&nbsp;?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>La densité de la laine de bois est insufflée à 45kg / m3. Elle est donc prisonnière du bloc et ne se tasse pas au fil des années.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quel est le R des murs ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le R des murs est de 5,26 puisque l’on utilise de la fibre de bois qui a un lambda de 0,038.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il du déphasage ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Pour le déphasage des murs, nous sommes aux alentours de 8h50 sur 200 mm d’isolant mais ce qui est le plus important est de regarder, si on travaille en façade ventilée.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans notre cas, toutes les façades le sont, car nous équipons nos maisons d’un revêtement crépis ou avec un bardage posé avec une lame d’air afin de combattre la chaleur et le rayonnement du soleil.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Comme toute maison bio climatique, nous portons une attention toute particulière aux ouvertures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La pose de casquettes au-dessus des grandes baies vitrées ou des stores adaptés seront mis en œuvre dès que cela est nécessaire aux heures les plus chaudes afin d’éviter le rayonnement intérieur et la montée en température.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir un très bon déphasage dans les murs c’est très bien, mais si le soleil tape directement dans les baies, cela ne sert à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le bloc constructif convient-il pour la RE2020 ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Aujourd’hui, il existe encore trop de flou sur cette nouvelle réglementation environnementale qui n’est pas encore en place.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On entend beaucoup de chose, mais rien n’est encore très clair de ce point de vue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On sait déjà qu’elle met en avant les matériaux biosourcés, ce qui est le cas de nos blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Côté isolant, avec 200 mm de fibre de bois, nous sommes certains d’être dans la norme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si elle reprend les grandes lignes de la RT 2012, c’est plus une norme de système, qui prend en compte les composants d’en la globalité, en regard à la maison en elle-même. (Ventilation, chauffage etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir des murs, plancher et toiture bien isolée, si le système de chauffage est énergivore, ou que la ventilation ne garantie pas une qualité de l’air intérieure optimale, cela ne sert encore une fois à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nous prenons en compte tous ces paramètres lors de nos réalisations afin d’optimiser les consommations d’énergie et d’offrir à notre clientèle une qualité de vie optimale et saine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il des COV (composés organiques volatils) ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs utilisent des panneaux OSB de type E1, donc on fait vraiment attention à choisir des panneaux qui soient les moins émetteurs de COV.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pareil pour la colle que l’on utilise, ce sont des colles sans formaldéhyde, on veille à avoir des composants les moins nocifs pour la qualité de l’air intérieure de nos maisons bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>Les dalles bois Zéro béton</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Elles offrent une alternative aboutie pour une maison 100% bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos dalles sont mises en œuvre en combinant une structure porteuse sur laquelle repose des poutres en I sur lesquelles sont placés les éléments de sols.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tous nos composants sont pré-taillés pour faciliter la mise en œuvre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Elles peuvent se poser sur des plots en béton ou sur des pieux vissés.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":218,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_Details-600x342-1.png\" alt=\"\" class=\"wp-image-218\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Caractéristiques :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Ceinture porteuse et sommiers en lamibois, ou lamellé-collé pré-taillés, pour pose sur plots béton ou pieux vissés (reprise des charges du plancher et des murs)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Solivage porteur poutre en I ou bois massif abouté</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Isolant intégré en fibre de bois épaisseur 200 mm R = 5,25 m2.k/W</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Pare vapeur faisant pare pluie de type sarking pour protéger temporairement l’isolant des intempéries.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<figure class=\"wp-block-image aligncenter size-large\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_MeP-copie-1024x537.png\" alt=\"\" class=\"wp-image-224\"/><figcaption class=\"wp-element-caption text center text-green\">Mise en place d’une dalle bois</figcaption></figure>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<div class=\"text-center\">\n  <div class=\"row\">\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMIBOIS</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamibois.png\" alt=\"lamibois\" class=\"wp-image-224\"></figure> \n    </div>\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMELLÉ COLLÉ</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamelle-colle.png\" alt=\"lamellé collé\" class=\"wp-image-224\"></figure>\n    </div>\n  </div>\n</div>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les murs porteurs</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos caissons permettent de réaliser des murs de toutes formes et acceptent toutes finitions, offrant ainsi une liberté architecturale totale.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs modulaires présentent une structure bois dans laquelle est insufflé une isolation en fibre de bois !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La combinaison innovante de ces matériaux écologiques permet d’obtenir des performances thermiques proches du passif avec les avantages de la préfabrication bois qui nous fera gagner du temps lors de la construction de nos maison grâce aux études réalisées en amont !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":245,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Schema-600x366-1.png\" alt=\"\" class=\"wp-image-245\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>La façade est fractionnée en éléments de différentes tailles (hauteur d’étage, allèges, linteaux) et de différentes formes (pignons triangulaires, angles non droits etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Éléments porteurs jusqu’à R+2 : reprise de charge 9 tonnes/ml</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Isolant fibre de bois intégré R de base = 5.26 m2.k/W</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Performance été-hiver :</strong>&nbsp;déphasage de 8h50</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Étanche à l’air</strong>&nbsp;sans ajout de membrane</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Ouvert à la diffusion de vapeur d’eau</strong></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":250,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Details-600x410-1.png\" alt=\"\" class=\"wp-image-250\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Un bloc préfabriqué, 100 % sur mesure, déclinable en plus d’un million de formes différentes</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Manipulation aisée : le bloc hauteur d’étage mesure 2.80 m pour un poids de 60 kg</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Rapidité d’exécution : 100 m² au sol = 3 personnes en 2 jours</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Avantage du bois sans ses inconvénients : extrêmement stable sur le plan dimensionnel, l’OSB ne subit pas les variations hygrométriques de l’air contrairement au bois massif qui se gonfle et se rétracte</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tout est compris : lisses basses, quincaillerie, joints d’étanchéité, …</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher lamellé collé :</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Plancher lamellé-collé bois sous face apparente</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de dalles lamellé-collées de largeur 600 mm, d’épaisseur de 140 mm et d’une portée pouvant aller jusqu’à 6m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Grâce à l’épaisseur importante de la dalle, l’isolation sonore sera équivalente à une dalle béton, elle pourra, en plus, rester en sous face apparente !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher poutres Posi</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Poutre Posi</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une solution composée de poutres en bois et de membrures métalliques combinant légèreté et rigidité pour des portées allant jusqu’à 14 m sans porteur intermédiaire.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette solution facilite le passage des gaines de ventilation, des canalisations, sans aucun perçage.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":265,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Poutre-Posi.jpg\" alt=\"\" class=\"wp-image-265\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<br><p>Une offre structure complémentaire pour solutionner les planchers intermédiaires, avec deux produits techniques : la poutre en I ou la dalle lamellé-collé !</p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":266,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_Detail-600x540-1.png\" alt=\"\" class=\"wp-image-266\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER&nbsp;POUTRE EN I&nbsp;:</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de poutres porteuses, sommiers, poteaux et de trémie d’escalier suivi d’un plancher léger pré-taillé ayant une portée pouvant aller jusqu’à 7m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Manutention aisée, pose rapide et planéité facile à obtenir</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Percement des poutres simple pour passer les réseaux techniques dans l’épaisseur du plancher</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stabilité dimensionnelle des poutres en I, élimine tous les problèmes liés aux grincements du plancher.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER LAMELLÉ-COLLÉ :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->', 'Concept', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2023-03-29 18:42:33', '2023-03-29 16:42:33', '', 22, 'https://etic.alainbroye.fr/?p=279', 0, 'revision', '', 0);
INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(280, 1, '2023-03-29 19:24:48', '2023-03-29 17:24:48', '<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>LES BLOCS MODULAIRES</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le Bloc constructif est une solution écologique pour nos projets de construction de maison bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>C’est un bloc modulaire 100% bois, isolé et biosourcé. Il s’adapte à tous types d’architectures et nous laisse libre de bâtir la maison qui ressemble à nos clients !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Notre fournisseur développe et fabrique un système complet de blocs modulaires préfabriqués en bois comprenant murs, dalles, planchers, et éléments de toitures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce système est adaptable à toutes les envies architecturales et offre des performances thermiques supérieures aux normes en vigueur grâce à leur isolation en fibre de bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":127,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/details_offre-768x561-1.png\" alt=\"\" class=\"wp-image-127\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les avantages d’une construction en Blocs constructifs sont nombreux :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Confort thermique : au chaud l’hiver, au frais l’été,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Maison basse consommation,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Mise en œuvre rapide (nos projets sont réalisés en moins de 6 mois),</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Pas de limites architecturales,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>100% bois et biosourcé.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Comment le bloc est-il fabriqué ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont fabriqués en France dans les ateliers du fabricant situé en Savoie à moins de 300 km de Manosque. Ceci afin de limiter notre emprunte carbone et garantir nos délais de livraison.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont composés de panneau OSB Fibertech découpés, assemblés, pressés et stockés pour nous directement chez le fabricant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les équipes réalisent des contrôles continus en atelier pour l’équerrage et le dimensionnement des blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelles sont les garanties ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont certifiés CTB par FCBA et ont une garantie décennale fabricant comme tous fabricants d’ossature bois ou autre solution constructive.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelle est la densité de la laine de bois contenue dans les blocs&nbsp;?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>La densité de la laine de bois est insufflée à 45kg / m3. Elle est donc prisonnière du bloc et ne se tasse pas au fil des années.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quel est le R des murs ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le R des murs est de 5,26 puisque l’on utilise de la fibre de bois qui a un lambda de 0,038.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il du déphasage ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Pour le déphasage des murs, nous sommes aux alentours de 8h50 sur 200 mm d’isolant mais ce qui est le plus important est de regarder, si on travaille en façade ventilée.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans notre cas, toutes les façades le sont, car nous équipons nos maisons d’un revêtement crépis ou avec un bardage posé avec une lame d’air afin de combattre la chaleur et le rayonnement du soleil.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Comme toute maison bio climatique, nous portons une attention toute particulière aux ouvertures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La pose de casquettes au-dessus des grandes baies vitrées ou des stores adaptés seront mis en œuvre dès que cela est nécessaire aux heures les plus chaudes afin d’éviter le rayonnement intérieur et la montée en température.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir un très bon déphasage dans les murs c’est très bien, mais si le soleil tape directement dans les baies, cela ne sert à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le bloc constructif convient-il pour la RE2020 ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Aujourd’hui, il existe encore trop de flou sur cette nouvelle réglementation environnementale qui n’est pas encore en place.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On entend beaucoup de chose, mais rien n’est encore très clair de ce point de vue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On sait déjà qu’elle met en avant les matériaux biosourcés, ce qui est le cas de nos blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Côté isolant, avec 200 mm de fibre de bois, nous sommes certains d’être dans la norme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si elle reprend les grandes lignes de la RT 2012, c’est plus une norme de système, qui prend en compte les composants d’en la globalité, en regard à la maison en elle-même. (Ventilation, chauffage etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir des murs, plancher et toiture bien isolée, si le système de chauffage est énergivore, ou que la ventilation ne garantie pas une qualité de l’air intérieure optimale, cela ne sert encore une fois à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nous prenons en compte tous ces paramètres lors de nos réalisations afin d’optimiser les consommations d’énergie et d’offrir à notre clientèle une qualité de vie optimale et saine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il des COV (composés organiques volatils) ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs utilisent des panneaux OSB de type E1, donc on fait vraiment attention à choisir des panneaux qui soient les moins émetteurs de COV.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pareil pour la colle que l’on utilise, ce sont des colles sans formaldéhyde, on veille à avoir des composants les moins nocifs pour la qualité de l’air intérieure de nos maisons bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>Les dalles bois Zéro béton</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Elles offrent une alternative aboutie pour une maison 100% bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos dalles sont mises en œuvre en combinant une structure porteuse sur laquelle repose des poutres en I sur lesquelles sont placés les éléments de sols.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tous nos composants sont pré-taillés pour faciliter la mise en œuvre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Elles peuvent se poser sur des plots en béton ou sur des pieux vissés.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":218,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_Details-600x342-1.png\" alt=\"\" class=\"wp-image-218\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Caractéristiques :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Ceinture porteuse et sommiers en lamibois, ou lamellé-collé pré-taillés, pour pose sur plots béton ou pieux vissés (reprise des charges du plancher et des murs)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Solivage porteur poutre en I ou bois massif abouté</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Isolant intégré en fibre de bois épaisseur 200 mm R = 5,25 m2.k/W</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Pare vapeur faisant pare pluie de type sarking pour protéger temporairement l’isolant des intempéries.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<figure class=\"wp-block-image aligncenter size-large\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_MeP-copie-1024x537.png\" alt=\"\" class=\"wp-image-224\"/><figcaption class=\"wp-element-caption text center text-green\">Mise en place d’une dalle bois</figcaption></figure>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<div class=\"text-center\">\n  <div class=\"row\">\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMIBOIS</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamibois.png\" alt=\"lamibois\" class=\"wp-image-224\"></figure> \n    </div>\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMELLÉ COLLÉ</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamelle-colle.png\" alt=\"lamellé collé\" class=\"wp-image-224\"></figure>\n    </div>\n  </div>\n</div>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les murs porteurs</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos caissons permettent de réaliser des murs de toutes formes et acceptent toutes finitions, offrant ainsi une liberté architecturale totale.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs modulaires présentent une structure bois dans laquelle est insufflé une isolation en fibre de bois !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La combinaison innovante de ces matériaux écologiques permet d’obtenir des performances thermiques proches du passif avec les avantages de la préfabrication bois qui nous fera gagner du temps lors de la construction de nos maison grâce aux études réalisées en amont !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":245,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Schema-600x366-1.png\" alt=\"\" class=\"wp-image-245\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>La façade est fractionnée en éléments de différentes tailles (hauteur d’étage, allèges, linteaux) et de différentes formes (pignons triangulaires, angles non droits etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Éléments porteurs jusqu’à R+2 : reprise de charge 9 tonnes/ml</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Isolant fibre de bois intégré R de base = 5.26 m2.k/W</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Performance été-hiver :</strong>&nbsp;déphasage de 8h50</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Étanche à l’air</strong>&nbsp;sans ajout de membrane</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Ouvert à la diffusion de vapeur d’eau</strong></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":250,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Details-600x410-1.png\" alt=\"\" class=\"wp-image-250\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Un bloc préfabriqué, 100 % sur mesure, déclinable en plus d’un million de formes différentes</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Manipulation aisée : le bloc hauteur d’étage mesure 2.80 m pour un poids de 60 kg</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Rapidité d’exécution : 100 m² au sol = 3 personnes en 2 jours</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Avantage du bois sans ses inconvénients : extrêmement stable sur le plan dimensionnel, l’OSB ne subit pas les variations hygrométriques de l’air contrairement au bois massif qui se gonfle et se rétracte</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tout est compris : lisses basses, quincaillerie, joints d’étanchéité, …</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher lamellé collé :</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Plancher lamellé-collé bois sous face apparente</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de dalles lamellé-collées de largeur 600 mm, d’épaisseur de 140 mm et d’une portée pouvant aller jusqu’à 6m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Grâce à l’épaisseur importante de la dalle, l’isolation sonore sera équivalente à une dalle béton, elle pourra, en plus, rester en sous face apparente !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher poutres Posi</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Poutre Posi</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une solution composée de poutres en bois et de membrures métalliques combinant légèreté et rigidité pour des portées allant jusqu’à 14 m sans porteur intermédiaire.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette solution facilite le passage des gaines de ventilation, des canalisations, sans aucun perçage.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":265,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Poutre-Posi.jpg\" alt=\"\" class=\"wp-image-265\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<br><p>Une offre structure complémentaire pour solutionner les planchers intermédiaires, avec deux produits techniques : la poutre en I ou la dalle lamellé-collé !</p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":266,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_Detail-600x540-1.png\" alt=\"\" class=\"wp-image-266\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER&nbsp;POUTRE EN I&nbsp;:</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de poutres porteuses, sommiers, poteaux et de trémie d’escalier suivi d’un plancher léger pré-taillé ayant une portée pouvant aller jusqu’à 7m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Manutention aisée, pose rapide et planéité facile à obtenir</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Percement des poutres simple pour passer les réseaux techniques dans l’épaisseur du plancher</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stabilité dimensionnelle des poutres en I, élimine tous les problèmes liés aux grincements du plancher.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER LAMELLÉ-COLLÉ :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->', 'Le Concept des maisons Étic', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2023-03-29 19:24:48', '2023-03-29 17:24:48', '', 22, 'https://etic.alainbroye.fr/?p=280', 0, 'revision', '', 0),
(281, 1, '2023-03-29 19:25:12', '2023-03-29 17:25:12', '<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>LES BLOCS MODULAIRES</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le Bloc constructif est une solution écologique pour nos projets de construction de maison bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>C’est un bloc modulaire 100% bois, isolé et biosourcé. Il s’adapte à tous types d’architectures et nous laisse libre de bâtir la maison qui ressemble à nos clients !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Notre fournisseur développe et fabrique un système complet de blocs modulaires préfabriqués en bois comprenant murs, dalles, planchers, et éléments de toitures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce système est adaptable à toutes les envies architecturales et offre des performances thermiques supérieures aux normes en vigueur grâce à leur isolation en fibre de bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":127,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/details_offre-768x561-1.png\" alt=\"\" class=\"wp-image-127\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les avantages d’une construction en Blocs constructifs sont nombreux :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Confort thermique : au chaud l’hiver, au frais l’été,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Maison basse consommation,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Mise en œuvre rapide (nos projets sont réalisés en moins de 6 mois),</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Pas de limites architecturales,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>100% bois et biosourcé.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Comment le bloc est-il fabriqué ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont fabriqués en France dans les ateliers du fabricant situé en Savoie à moins de 300 km de Manosque. Ceci afin de limiter notre emprunte carbone et garantir nos délais de livraison.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont composés de panneau OSB Fibertech découpés, assemblés, pressés et stockés pour nous directement chez le fabricant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les équipes réalisent des contrôles continus en atelier pour l’équerrage et le dimensionnement des blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelles sont les garanties ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont certifiés CTB par FCBA et ont une garantie décennale fabricant comme tous fabricants d’ossature bois ou autre solution constructive.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelle est la densité de la laine de bois contenue dans les blocs&nbsp;?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>La densité de la laine de bois est insufflée à 45kg / m3. Elle est donc prisonnière du bloc et ne se tasse pas au fil des années.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quel est le R des murs ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le R des murs est de 5,26 puisque l’on utilise de la fibre de bois qui a un lambda de 0,038.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il du déphasage ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Pour le déphasage des murs, nous sommes aux alentours de 8h50 sur 200 mm d’isolant mais ce qui est le plus important est de regarder, si on travaille en façade ventilée.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans notre cas, toutes les façades le sont, car nous équipons nos maisons d’un revêtement crépis ou avec un bardage posé avec une lame d’air afin de combattre la chaleur et le rayonnement du soleil.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Comme toute maison bio climatique, nous portons une attention toute particulière aux ouvertures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La pose de casquettes au-dessus des grandes baies vitrées ou des stores adaptés seront mis en œuvre dès que cela est nécessaire aux heures les plus chaudes afin d’éviter le rayonnement intérieur et la montée en température.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir un très bon déphasage dans les murs c’est très bien, mais si le soleil tape directement dans les baies, cela ne sert à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le bloc constructif convient-il pour la RE2020 ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Aujourd’hui, il existe encore trop de flou sur cette nouvelle réglementation environnementale qui n’est pas encore en place.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On entend beaucoup de chose, mais rien n’est encore très clair de ce point de vue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On sait déjà qu’elle met en avant les matériaux biosourcés, ce qui est le cas de nos blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Côté isolant, avec 200 mm de fibre de bois, nous sommes certains d’être dans la norme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si elle reprend les grandes lignes de la RT 2012, c’est plus une norme de système, qui prend en compte les composants d’en la globalité, en regard à la maison en elle-même. (Ventilation, chauffage etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir des murs, plancher et toiture bien isolée, si le système de chauffage est énergivore, ou que la ventilation ne garantie pas une qualité de l’air intérieure optimale, cela ne sert encore une fois à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nous prenons en compte tous ces paramètres lors de nos réalisations afin d’optimiser les consommations d’énergie et d’offrir à notre clientèle une qualité de vie optimale et saine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il des COV (composés organiques volatils) ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs utilisent des panneaux OSB de type E1, donc on fait vraiment attention à choisir des panneaux qui soient les moins émetteurs de COV.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pareil pour la colle que l’on utilise, ce sont des colles sans formaldéhyde, on veille à avoir des composants les moins nocifs pour la qualité de l’air intérieure de nos maisons bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>Les dalles bois Zéro béton</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Elles offrent une alternative aboutie pour une maison 100% bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos dalles sont mises en œuvre en combinant une structure porteuse sur laquelle repose des poutres en I sur lesquelles sont placés les éléments de sols.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tous nos composants sont pré-taillés pour faciliter la mise en œuvre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Elles peuvent se poser sur des plots en béton ou sur des pieux vissés.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":218,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_Details-600x342-1.png\" alt=\"\" class=\"wp-image-218\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Caractéristiques :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Ceinture porteuse et sommiers en lamibois, ou lamellé-collé pré-taillés, pour pose sur plots béton ou pieux vissés (reprise des charges du plancher et des murs)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Solivage porteur poutre en I ou bois massif abouté</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Isolant intégré en fibre de bois épaisseur 200 mm R = 5,25 m2.k/W</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Pare vapeur faisant pare pluie de type sarking pour protéger temporairement l’isolant des intempéries.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<figure class=\"wp-block-image aligncenter size-large\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_MeP-copie-1024x537.png\" alt=\"\" class=\"wp-image-224\"/><figcaption class=\"wp-element-caption text center text-green\">Mise en place d’une dalle bois</figcaption></figure>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<div class=\"text-center\">\n  <div class=\"row\">\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMIBOIS</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamibois.png\" alt=\"lamibois\" class=\"wp-image-224\"></figure> \n    </div>\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMELLÉ COLLÉ</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamelle-colle.png\" alt=\"lamellé collé\" class=\"wp-image-224\"></figure>\n    </div>\n  </div>\n</div>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les murs porteurs</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos caissons permettent de réaliser des murs de toutes formes et acceptent toutes finitions, offrant ainsi une liberté architecturale totale.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs modulaires présentent une structure bois dans laquelle est insufflé une isolation en fibre de bois !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La combinaison innovante de ces matériaux écologiques permet d’obtenir des performances thermiques proches du passif avec les avantages de la préfabrication bois qui nous fera gagner du temps lors de la construction de nos maison grâce aux études réalisées en amont !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":245,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Schema-600x366-1.png\" alt=\"\" class=\"wp-image-245\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>La façade est fractionnée en éléments de différentes tailles (hauteur d’étage, allèges, linteaux) et de différentes formes (pignons triangulaires, angles non droits etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Éléments porteurs jusqu’à R+2 : reprise de charge 9 tonnes/ml</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Isolant fibre de bois intégré R de base = 5.26 m2.k/W</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Performance été-hiver :</strong>&nbsp;déphasage de 8h50</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Étanche à l’air</strong>&nbsp;sans ajout de membrane</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Ouvert à la diffusion de vapeur d’eau</strong></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":250,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Details-600x410-1.png\" alt=\"\" class=\"wp-image-250\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Un bloc préfabriqué, 100 % sur mesure, déclinable en plus d’un million de formes différentes</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Manipulation aisée : le bloc hauteur d’étage mesure 2.80 m pour un poids de 60 kg</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Rapidité d’exécution : 100 m² au sol = 3 personnes en 2 jours</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Avantage du bois sans ses inconvénients : extrêmement stable sur le plan dimensionnel, l’OSB ne subit pas les variations hygrométriques de l’air contrairement au bois massif qui se gonfle et se rétracte</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tout est compris : lisses basses, quincaillerie, joints d’étanchéité, …</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher lamellé collé :</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Plancher lamellé-collé bois sous face apparente</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de dalles lamellé-collées de largeur 600 mm, d’épaisseur de 140 mm et d’une portée pouvant aller jusqu’à 6m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Grâce à l’épaisseur importante de la dalle, l’isolation sonore sera équivalente à une dalle béton, elle pourra, en plus, rester en sous face apparente !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher poutres Posi</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Poutre Posi</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une solution composée de poutres en bois et de membrures métalliques combinant légèreté et rigidité pour des portées allant jusqu’à 14 m sans porteur intermédiaire.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette solution facilite le passage des gaines de ventilation, des canalisations, sans aucun perçage.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":265,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Poutre-Posi.jpg\" alt=\"\" class=\"wp-image-265\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<br><p>Une offre structure complémentaire pour solutionner les planchers intermédiaires, avec deux produits techniques : la poutre en I ou la dalle lamellé-collé !</p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":266,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_Detail-600x540-1.png\" alt=\"\" class=\"wp-image-266\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER&nbsp;POUTRE EN I&nbsp;:</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de poutres porteuses, sommiers, poteaux et de trémie d’escalier suivi d’un plancher léger pré-taillé ayant une portée pouvant aller jusqu’à 7m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Manutention aisée, pose rapide et planéité facile à obtenir</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Percement des poutres simple pour passer les réseaux techniques dans l’épaisseur du plancher</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stabilité dimensionnelle des poutres en I, élimine tous les problèmes liés aux grincements du plancher.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER LAMELLÉ-COLLÉ :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->', 'Concept', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2023-03-29 19:25:12', '2023-03-29 17:25:12', '', 22, 'https://etic.alainbroye.fr/?p=281', 0, 'revision', '', 0);
INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(282, 1, '2023-03-29 19:25:51', '2023-03-29 17:25:51', '<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>LES BLOCS MODULAIRES</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le Bloc constructif est une solution écologique pour nos projets de construction de maison bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>C’est un bloc modulaire 100% bois, isolé et biosourcé. Il s’adapte à tous types d’architectures et nous laisse libre de bâtir la maison qui ressemble à nos clients !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Notre fournisseur développe et fabrique un système complet de blocs modulaires préfabriqués en bois comprenant murs, dalles, planchers, et éléments de toitures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce système est adaptable à toutes les envies architecturales et offre des performances thermiques supérieures aux normes en vigueur grâce à leur isolation en fibre de bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":127,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/details_offre-768x561-1.png\" alt=\"\" class=\"wp-image-127\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les avantages d’une construction en Blocs constructifs sont nombreux :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Confort thermique : au chaud l’hiver, au frais l’été,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Maison basse consommation,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Mise en œuvre rapide (nos projets sont réalisés en moins de 6 mois),</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Pas de limites architecturales,</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>100% bois et biosourcé.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Comment le bloc est-il fabriqué ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont fabriqués en France dans les ateliers du fabricant situé en Savoie à moins de 300 km de Manosque. Ceci afin de limiter notre emprunte carbone et garantir nos délais de livraison.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont composés de panneau OSB Fibertech découpés, assemblés, pressés et stockés pour nous directement chez le fabricant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les équipes réalisent des contrôles continus en atelier pour l’équerrage et le dimensionnement des blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelles sont les garanties ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Les blocs sont certifiés CTB par FCBA et ont une garantie décennale fabricant comme tous fabricants d’ossature bois ou autre solution constructive.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quelle est la densité de la laine de bois contenue dans les blocs&nbsp;?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>La densité de la laine de bois est insufflée à 45kg / m3. Elle est donc prisonnière du bloc et ne se tasse pas au fil des années.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Quel est le R des murs ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le R des murs est de 5,26 puisque l’on utilise de la fibre de bois qui a un lambda de 0,038.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il du déphasage ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Pour le déphasage des murs, nous sommes aux alentours de 8h50 sur 200 mm d’isolant mais ce qui est le plus important est de regarder, si on travaille en façade ventilée.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans notre cas, toutes les façades le sont, car nous équipons nos maisons d’un revêtement crépis ou avec un bardage posé avec une lame d’air afin de combattre la chaleur et le rayonnement du soleil.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Comme toute maison bio climatique, nous portons une attention toute particulière aux ouvertures.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La pose de casquettes au-dessus des grandes baies vitrées ou des stores adaptés seront mis en œuvre dès que cela est nécessaire aux heures les plus chaudes afin d’éviter le rayonnement intérieur et la montée en température.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir un très bon déphasage dans les murs c’est très bien, mais si le soleil tape directement dans les baies, cela ne sert à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le bloc constructif convient-il pour la RE2020 ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Aujourd’hui, il existe encore trop de flou sur cette nouvelle réglementation environnementale qui n’est pas encore en place.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On entend beaucoup de chose, mais rien n’est encore très clair de ce point de vue.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On sait déjà qu’elle met en avant les matériaux biosourcés, ce qui est le cas de nos blocs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Côté isolant, avec 200 mm de fibre de bois, nous sommes certains d’être dans la norme.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si elle reprend les grandes lignes de la RT 2012, c’est plus une norme de système, qui prend en compte les composants d’en la globalité, en regard à la maison en elle-même. (Ventilation, chauffage etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Avoir des murs, plancher et toiture bien isolée, si le système de chauffage est énergivore, ou que la ventilation ne garantie pas une qualité de l’air intérieure optimale, cela ne sert encore une fois à rien.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nous prenons en compte tous ces paramètres lors de nos réalisations afin d’optimiser les consommations d’énergie et d’offrir à notre clientèle une qualité de vie optimale et saine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Qu\'en est-il des COV (composés organiques volatils) ?</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs utilisent des panneaux OSB de type E1, donc on fait vraiment attention à choisir des panneaux qui soient les moins émetteurs de COV.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pareil pour la colle que l’on utilise, ce sont des colles sans formaldéhyde, on veille à avoir des composants les moins nocifs pour la qualité de l’air intérieure de nos maisons bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2 class=\"text-green text-center\"><strong>Les dalles bois Zéro béton</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Elles offrent une alternative aboutie pour une maison 100% bois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos dalles sont mises en œuvre en combinant une structure porteuse sur laquelle repose des poutres en I sur lesquelles sont placés les éléments de sols.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tous nos composants sont pré-taillés pour faciliter la mise en œuvre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Elles peuvent se poser sur des plots en béton ou sur des pieux vissés.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":218,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_Details-600x342-1.png\" alt=\"\" class=\"wp-image-218\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Caractéristiques :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Ceinture porteuse et sommiers en lamibois, ou lamellé-collé pré-taillés, pour pose sur plots béton ou pieux vissés (reprise des charges du plancher et des murs)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Solivage porteur poutre en I ou bois massif abouté</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Isolant intégré en fibre de bois épaisseur 200 mm R = 5,25 m2.k/W</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Pare vapeur faisant pare pluie de type sarking pour protéger temporairement l’isolant des intempéries.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<figure class=\"wp-block-image aligncenter size-large\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Dalles_MeP-copie-1024x537.png\" alt=\"\" class=\"wp-image-224\"><figcaption class=\"wp-element-caption text center text-green\">Mise en place d’une dalle bois</figcaption></figure>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<div class=\"text-center\">\n  <div class=\"row\">\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMIBOIS</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamibois.png\" alt=\"lamibois\" class=\"wp-image-224\"></figure> \n    </div>\n    <div class=\"col\">\n      <figcaption class=\"wp-element-caption text-green\">LAMELLÉ COLLÉ</figcaption>\n      <figure class=\"wp-block-image text-center\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/lamelle-colle.png\" alt=\"lamellé collé\" class=\"wp-image-224\"></figure>\n    </div>\n  </div>\n</div>\n<!-- /wp:html -->\n\n<!-- wp:html -->\n<p class=\"text-green\"><strong>Les murs porteurs</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Nos caissons permettent de réaliser des murs de toutes formes et acceptent toutes finitions, offrant ainsi une liberté architecturale totale.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos blocs modulaires présentent une structure bois dans laquelle est insufflé une isolation en fibre de bois !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La combinaison innovante de ces matériaux écologiques permet d’obtenir des performances thermiques proches du passif avec les avantages de la préfabrication bois qui nous fera gagner du temps lors de la construction de nos maison grâce aux études réalisées en amont !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":245,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Schema-600x366-1.png\" alt=\"\" class=\"wp-image-245\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>La façade est fractionnée en éléments de différentes tailles (hauteur d’étage, allèges, linteaux) et de différentes formes (pignons triangulaires, angles non droits etc…).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Éléments porteurs jusqu’à R+2 : reprise de charge 9 tonnes/ml</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Isolant fibre de bois intégré R de base = 5.26 m2.k/W</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Performance été-hiver :</strong>&nbsp;déphasage de 8h50</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Étanche à l’air</strong>&nbsp;sans ajout de membrane</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong class=\"text-green\">Ouvert à la diffusion de vapeur d’eau</strong></li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":250,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Murs_Details-600x410-1.png\" alt=\"\" class=\"wp-image-250\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Un bloc préfabriqué, 100 % sur mesure, déclinable en plus d’un million de formes différentes</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Manipulation aisée : le bloc hauteur d’étage mesure 2.80 m pour un poids de 60 kg</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Rapidité d’exécution : 100 m² au sol = 3 personnes en 2 jours</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Avantage du bois sans ses inconvénients : extrêmement stable sur le plan dimensionnel, l’OSB ne subit pas les variations hygrométriques de l’air contrairement au bois massif qui se gonfle et se rétracte</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tout est compris : lisses basses, quincaillerie, joints d’étanchéité, …</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher lamellé collé :</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Plancher lamellé-collé bois sous face apparente</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de dalles lamellé-collées de largeur 600 mm, d’épaisseur de 140 mm et d’une portée pouvant aller jusqu’à 6m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Grâce à l’épaisseur importante de la dalle, l’isolation sonore sera équivalente à une dalle béton, elle pourra, en plus, rester en sous face apparente !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<p class=\"text-green\">Le plancher poutres Posi</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Poutre Posi</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une solution composée de poutres en bois et de membrures métalliques combinant légèreté et rigidité pour des portées allant jusqu’à 14 m sans porteur intermédiaire.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cette solution facilite le passage des gaines de ventilation, des canalisations, sans aucun perçage.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":265,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Poutre-Posi.jpg\" alt=\"\" class=\"wp-image-265\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<br><p>Une offre structure complémentaire pour solutionner les planchers intermédiaires, avec deux produits techniques : la poutre en I ou la dalle lamellé-collé !</p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":266,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_Detail-600x540-1.png\" alt=\"\" class=\"wp-image-266\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER&nbsp;POUTRE EN I&nbsp;:</strong></h2>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":260,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_PoutreI-600x214-1.png\" alt=\"\" class=\"wp-image-260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Caractéristiques :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Structure primaire pré-taillée, composée de poutres porteuses, sommiers, poteaux et de trémie d’escalier suivi d’un plancher léger pré-taillé ayant une portée pouvant aller jusqu’à 7m !</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong class=\"text-green\">Les + :</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Manutention aisée, pose rapide et planéité facile à obtenir</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Percement des poutres simple pour passer les réseaux techniques dans l’épaisseur du plancher</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stabilité dimensionnelle des poutres en I, élimine tous les problèmes liés aux grincements du plancher.</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:html -->\n<h2 class=\"text-center\"><strong class=\"text-green\">PLANCHER LAMELLÉ-COLLÉ :</strong></p>\n<!-- /wp:html -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":263,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full\"><img src=\"https://etic.alainbroye.fr/wp-content/uploads/2023/03/Plancher_LC-600x239-1.png\" alt=\"\" class=\"wp-image-263\"/></figure>\n<!-- /wp:image -->', 'Le concept des maisons Étic', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2023-03-29 19:25:51', '2023-03-29 17:25:51', '', 22, 'https://etic.alainbroye.fr/?p=282', 0, 'revision', '', 0);
